import { Link } from "react-router-dom";
import Paje_2 from "./Paje_2";

const Paje_1 = () => {
  return (
    <div className="paje-1">

      <h1>Quiz App</h1>
      <hr />

      <div className="queshtion">
        <h4>1. Which device is required for the Internet connections?</h4>
      </div>
      <div className="chois">
        <p>Modern</p>
        <p>Router</p>
        <p>LAN Coble</p>
        <p>Pen Drive</p>
      </div>
      <Link to={Paje_2}><button>Next</button></Link>
      <footer>1-5</footer>
    </div>

  )
}

export default Paje_1
